import React from 'react'

const RenderizarListas = () => {
  const [minhaListaNomes] = React.useState(["João", "Maria", "Pedro"])
  return (
    <div>
      <h2>Lista de Nomes</h2>
      <ul>
        {minhaListaNomes.map((nome, index) => (
          <li key={index}>{nome}</li>
        ))}
      </ul>
    </div>
  )
}

export default RenderizarListas
